import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    SortKey:'A'
  },
  mutations: {
    changSorts(state,params){
      state.SortKey = params
    }
  },

  actions: {
    changSort({commit},params){
      commit('changSorts',params)

    }
  }
})
